shared_preferences | pub.dev
Flutter数据存储之shared_preferences
Flutter 基于 shared_preferences 进行持久化键值存储


【翻译】
Shared preferences plugin（共享首选项插件）
包装特定于平台的持久性存储以获取简单数据
（iOS和macOS上为NSUserDefaults，Android上为SharedPreferences等）。数据可以异步保存到磁盘，
并且不能保证写入将在之后保留到磁盘
返回，因此该插件不得用于存储关键数据。
请设置约束为 shared_preferences: '>=0.5.y+x 
向后兼容1.0.0版本即将推出
插件已达到稳定的API，我们保证版本“ 1.0.0”将与“ 0.5.y + z”向后兼容。
请使用`shared_preferences：'> = 0.5.y + x 
有关更多详细信息，请参见：https://github.com/flutter/flutter/wiki/Package-migration-to-1.0.0 
用法
要使用此插件，请将shared_preferences添加为 pubspec.yaml文件中的依赖项.
